@barxik: To prawda, w nocy trochę mnie poniosło. W rzeczywistości podatku wyjdzie jakieś 4500 PLN, co razem z zusem daje nam niecałe 34% dla Państwa, a nie 43%. I tak procentowo wychodzi nieporównywalnie gorzej z tym co w NZ. Tutaj już nawet nie chodzi o sumy, a o wolną rękę w kwestii ubezpieczeń, której nasze Państwo niestety nam nie daje.

Musisz opłacać składki emerytalne i zdrowotne czy Ci się to podoba czy nie. Nie twierdzę, że nieopłacanie np. ubezpieczenia zdrowotnego jest dobre (na emeryturę wolałbym odkładać sobie własne oszczędności). Chodzi o to, że nie masz nawet żadnej alternatywnej możliwości wyboru ubezpieczyciela, bo jest tylko jedna opcja.

Poza tym ogromnym minusem tego międzypokoleniowego systemu zusowskiego jest uzależnienie płynności finansowej od przyrostu naturalnego.

